def fedora_package_installed(package: str) -> bool:
    """
    :param package: package to check
    :return: True if the package is installed in the Debian-like distribution, else False
    """

    command_line = "dnf list installed {}"
    args = shlex.split(command_line.format(package))
    try:
        output = subprocess.check_output(
            args, universal_newlines=True, stderr=subprocess.STDOUT
        )
        if output.find("{}.".format(package)) >= 0:
            return True
        else:
            return False
    except subprocess.CalledProcessError:
        return False


def dnf_prepare_base(base: "dnf.base.Base") -> None:
    """
    Prepare dnf base for querying. Includes extra steps for running on
    CentOS Stream
    :param base: the dnf base
    """

    # Code from http://dnf.readthedocs.org/en/latest/use_cases.html
    # Next two lines suggested by Neal Gompa (Conan-Kudo)
    base.conf.read()
    base.conf.substitutions.update_from_etc("/")

    # Repositories serve as sources of information about packages.
    base.read_all_repos()
    # A sack is needed for querying.
    base.fill_sack()


def dnf_return_package_version(package: str) -> str:
    """
    Use dnf Python module to get the version of a packager regardless of whether
    it is installed or not.

    Assumes dnf module is imported and the package name passed is unique.

    No error checking.

    :param package: exact package name in dnf
    :return: version string
    """

    with dnf.Base() as base:
        dnf_prepare_base(base)

        # A query matches all packages in sack
        q = base.sack.query()
        p = q.filter(name=package, latest=1)[0]

    return p.version


def apt_return_package_version(package: str) -> str:
    """
    Find package version of package (installed or not) using Debian's apt.

    No error checking

    :param package: package to get the version of
    :return: version in str format
    """

    if have_apt:
        cache = apt.Cache()
        versions = [LooseVersion(v.version) for v in cache[package].versions]
        version = max(versions)
        return str(version)
    else:
        cmd = f"apt info {package}"
        regex = r"^Version: (.+)$"
        output = run_command_c_lang(cmd=cmd)
        v = re.search(regex, output, re.MULTILINE)
        return v.group(1)


def opensuse_package_search(packages: str) -> str:
    """
    Return which of the packages have not already been installed on openSUSE.

    Does not catch exceptions.

    :param packages: the packages to to check, in a string separated by white space
    :return: list of packages
    """

    command_line = make_distro_packager_command(
        distro_family=Distro.opensuse,
        packages=packages,
        interactive=True,
        command="se",
        sudo=False,
    )
    args = shlex.split(command_line)
    return subprocess.check_output(args, universal_newlines=True)


def opensuse_known_packages(packages: str) -> List[str]:
    """
    Return which of the packages listed are able
    to be installed on this instance openSUSE.

    Does not catch exceptions.

    :param packages: the packages to to check, in a string separated by white space
    :return: list of packages
    """

    output = opensuse_package_search(packages)

    return [
        package
        for package in packages.split()
        if re.search(
            r"^(i\+)?\s+\|\s*{}".format(re.escape(package)), output, re.MULTILINE
        )
        is not None
    ]


def opensuse_missing_packages(packages: str) -> List[str]:
    """
    Return which of the packages have not already been installed on openSUSE.

    Does not catch exceptions.

    :param packages: the packages to to check, in a string separated by white space
    :return: list of packages
    """

    output = opensuse_package_search(packages)

    return [
        package
        for package in packages.split()
        if re.search(
            r"^i\+?\s+\|\s*{}".format(re.escape(package)), output, re.MULTILINE
        )
        is None
    ]


def opensuse_package_installed(package: str) -> bool:
    """
    :param package: package to check
    :return: True if the package is installed in the openSUSE distribution, else False
    """

    return not opensuse_missing_packages(package)


def opensuse_package_version(package: str) -> Optional[str]:
    """
    Use zypper to query openSUSE package information
    :param package: package to check
    :return: package version available in openSUSE archive if it exists, else None
    """

    command_line = make_distro_packager_command(
        distro_family=Distro.opensuse,
        packages=package,
        interactive=True,
        command="info",
        sudo=False,
    )
    args = shlex.split(command_line)
    output = subprocess.check_output(args, universal_newlines=True)
    m = re.search(r"^[Vv]ersion\s+:\s*(.+)$", output, re.MULTILINE)
    if m is not None:
        return m.group(1)
    return None


def package_in_pip_output(package: str, output: str) -> bool:
    """
    Determine if a package is found in the output of packages installed by pip
    :param package:
    :param output:
    :return: True if found, False otherwise
    """
    return (
        re.search("^{}\s".format(package), output, re.IGNORECASE | re.MULTILINE)
        is not None
    )


def uninstall_pip_package(package: str, no_deps_only: bool) -> None:
    """
    Uninstall a package from the local user using pip.

    Uninstall all local instances, including those installed multiple times,
    as can happen with the Debian patch to pip

    :param package: package to remove
    :param no_deps_only: if True, remove a package only if no other package
     depends on it
    """

    l_command_line = "list {}".format(pip_user)
    if pip_version >= StrictVersion("9.0.0"):
        # pip 9.0 issues a red warning if format not specified
        l_command_line = "{} --format=columns".format(l_command_line)
        if no_deps_only:
            l_command_line = "{} --not-required".format(l_command_line)

    l_args = make_pip_command(l_command_line)

    u_command_line = "uninstall -y {}".format(package)
    u_args = make_pip_command(u_command_line)
    while True:
        try:
            output = subprocess.check_output(l_args, universal_newlines=True)
            if package_in_pip_output(package, output):
                try:
                    subprocess.check_call(u_args)
                except subprocess.CalledProcessError:
                    print(
                        "Encountered an error uninstalling previous version installed with pip"
                    )
                    break
            else:
                break
        except Exception:
            break

    if package == "rapid-photo-downloader":
        home_bin = os.path.join(os.path.expanduser("~"), "bin")
        install_path = os.path.join(site.getuserbase(), "bin")

        if dir_accessible(home_bin):
            for executable in ("rapid-photo-downloader", "analyze-pv-structure"):
                symlink = os.path.join(home_bin, executable)
                if os.path.islink(symlink):
                    if os.readlink(symlink) == os.path.join(install_path, executable):
                        print("Removing symlink {}".format(symlink))
                        os.remove(symlink)


def uninstall_with_deps() -> None:
    uninstall_pip_package("rapid-photo-downloader", no_deps_only=False)

    packages = (
        "psutil gphoto2 pyzmq pyxdg arrow python-dateutil rawkit PyPrind colorlog "
        "easygui colour pymediainfo sortedcontainers requests tornado pyheif "
        "show-in-file-manager"
    )

    if pypi_pyqt5_capable():
        version = python_package_version("PyQt5")

        if version and StrictVersion(version) < StrictVersion("5.11"):
            packages = "{} PyQt5 sip".format(packages)
        else:
            packages = "{} PyQt5 PyQt5_sip".format(packages)

    for package in packages.split():
        uninstall_pip_package(package, no_deps_only=True)


def uninstall_old_version(
    distro_family: Distro, interactive: bool, installer_to_delete_on_error: str
) -> bool:
    """
    Uninstall old version of Rapid Photo Downloader that was installed using the
    distribution package manager and also with pip

    :param distro_family: the Linux distro family that this distro is in
    :param interactive: if True, the user should be prompted to confirm
     the commands
    :param installer_to_delete_on_error: full path of installer tar file, in
     temporary directory. The temp directory will be completely removed
     if there is an error.
    :return True if system package uninstalled, else False
    """

    system_uninstall = False

    pkg_name = "rapid-photo-downloader"

    if distro_family == Distro.debian:
        print(
            _(
                "Querying package system to see if an older version of Rapid Photo Downloader is "
                "installed (this may take a while)..."
            )
        )
        try:
            cache = apt.Cache()
            pkg = cache[pkg_name]
            if pkg.is_installed and query_uninstall(interactive):
                try:
                    v = pkg.versions[0]
                    name = v.package
                    version = v.version
                    package = "{} {}".format(name, version)
                except Exception:
                    package = pkg.name
                print(_("Uninstalling system package"), package)
                cmd = make_distro_packager_command(
                    distro_family, pkg_name, interactive, "remove"
                )
                run_cmd(cmd, installer_to_delete_on_error=installer_to_delete_on_error)
                system_uninstall = True
        except Exception as e:
            sys.stderr.write(_("Command failed") + "\n")
            sys.stderr.write(_("Exiting") + "\n")
            cleanup_on_exit(installer_to_delete_on_error)
            sys.exit(1)

    elif distro_family == Distro.fedora:
        print(
            _(
                "Querying package system to see if an older version of Rapid Photo "
                "Downloader is installed (this may take a while)..."
            )
        )
        with dnf.Base() as base:
            try:
                dnf_prepare_base(base)
            except dnf.exceptions.RepoError as e:
                print(
                    _(
                        "Unable to query package system. Please check your Internet "
                        "connection and try again."
                    )
                )
                print(e)
                sys.exit(1)

            q = base.sack.query()
            q_inst = q.installed()
            i = q_inst.filter(name=pkg_name)
            if len(list(i)) and query_uninstall(interactive):
                run_cmd(
                    make_distro_packager_command(
                        distro_family, pkg_name, interactive, "remove"
                    ),
                    installer_to_delete_on_error=installer_to_delete_on_error,
                )
                system_uninstall = True

    elif distro_family == Distro.opensuse:
        print(
            _(
                "Querying package system to see if an older version of Rapid Photo Downloader is "
                "installed (this may take a while)..."
            )
        )

        try:
            if opensuse_package_installed("rapid-photo-downloader") and query_uninstall(
                interactive
            ):
                run_cmd(
                    make_distro_packager_command(
                        distro_family, pkg_name, interactive, "rm"
                    ),
                    installer_to_delete_on_error=installer_to_delete_on_error,
                )
                system_uninstall = True

        except subprocess.CalledProcessError as e:
            if e.returncode != 104:
                sys.stderr.write(_("Command failed") + "\n")
                sys.stderr.write(_("Exiting") + "\n")
                cleanup_on_exit(installer_to_delete_on_error)
                sys.exit(1)

    # Translators: do not translate the term pip
    print(_("Checking if previous version installed with pip..."))
    uninstall_pip_package("rapid-photo-downloader", no_deps_only=False)

    return system_uninstall


def check_packages_on_other_systems(installer_to_delete_on_error: str) -> None:
    """
    Check to see if some (but not all) application dependencies are
    installed on systems that we are not explicitly analyzing.

    :param installer_to_delete_on_error: full path of installer tar file, in
     temporary directory. The temp directory will be completely removed
     if there is an error.
    """

    import_msgs = []

    if not pypi_pyqt5_capable():
        try:
            import PyQt5
        except ImportError:
            import_msgs.append("python3 variant of PyQt5")
    if not have_gi:
        import_msgs.append("python3 variant of gobject introspection")
    else:
        try:
            gi.require_version("GUdev", "1.0")
        except ValueError:
            import_msgs.append("GUdev 1.0 from gi.repository")
        try:
            gi.require_version("UDisks", "2.0")
        except ValueError:
            import_msgs.append("UDisks 2.0 from gi.repository")
        try:
            gi.require_version("GLib", "2.0")
        except ValueError:
            import_msgs.append("GLib 2.0 from gi.repository")
        try:
            gi.require_version("GExiv2", "0.10")
        except ValueError:
            import_msgs.append("GExiv2 0.10 from gi.repository")
        try:
            gi.require_version("Gst", "1.0")
        except ValueError:
            import_msgs.append("Gst 1.0 from gi.repository")
        try:
            gi.require_version("Notify", "0.7")
        except ValueError:
            import_msgs.append("Notify 0.7 from gi.repository")

    if shutil.which("exiftool") is None:
        import_msgs.append("ExifTool")
    if len(import_msgs):
        install_error_message = (
            "This program requires:\n{}\nPlease install them "
            "using your distribution's standard installation tools.\n"
        )
        sys.stderr.write(
            install_error_message.format("\n".join(s for s in import_msgs))
        )
        cleanup_on_exit(installer_to_delete_on_error=installer_to_delete_on_error)
        sys.exit(1)


def install_required_distro_packages(
    distro: Distro,
    distro_family: Distro,
    interactive: bool,
    system_uninstall: bool,
    venv: bool,
    install_pyqt5: bool,
    installer_to_delete_on_error: str,
) -> None:
    """
    Install packages supplied by the Linux distribution
    :param distro: the specific Linux distribution
    :param distro_family: the family of distros the Linux distribution belongs
     to
    :param interactive: if True, the user should be prompted to confirm
     the commands
    :param system_uninstall: if True, the system package Rapid Photo Downloader
     was uninstalled
    :param venv: installing into a virtual environment
    :param install_pyqt5: install PyQt5 from the distro packages
    :param installer_to_delete_on_error: full path of installer tar file, in
     temporary directory. The temp directory will be completely removed
     if there is an error.
    """

    if distro_family == Distro.debian:

        if have_apt:
            cache = apt.Cache()
        else:
            cache = []

        missing_packages = []
        packages = (
            "gstreamer1.0-libav gstreamer1.0-plugins-good libimage-exiftool-perl "
            "python3-dev intltool g++ exiv2 build-essential "
            "python3-wheel python3-setuptools gir1.2-gexiv2-0.10 libxkbcommon-x11-0 "
            "python3-gi gir1.2-gudev-1.0 gir1.2-udisks-2.0 gir1.2-notify-0.7 "
            "gir1.2-glib-2.0 gir1.2-gstreamer-1.0 gir1.2-gdkpixbuf-2.0 zenity "
            "libqt5x11extras5 libxcb-xinerama0 libimobiledevice-utils ifuse "
        )

        if install_pyqt5:
            packages = (
                f"{packages} python3-pyqt5 qt5-image-formats-plugins libqt5svg5 "
                "qtwayland5"
            )

        set_manually_installed = []

        # For some strange reason, setuptools and wheel must be manually specified
        # on Linux Mint. It's odd because sometimes setuptools imports even without this
        # package, and other times, it doesn't.

        if not venv:
            assert have_apt

            base_python_packages = "python3-requests"

            packages = f"{packages} {base_python_packages}"

            optional_python_packages = (
                op
                for op in "python3-easygui python3-sortedcontainers python3-tornado "
                "python3-zmq python3-arrow python3-psutil python3-colorlog "
                "python3-babel python3-colour python3-pymediainfo "
                "python3-tenacity python3-easygui".split()
                if op in cache
            )
            if optional_python_packages:
                op_packages = " ".join(optional_python_packages)
                packages = f"{packages} {op_packages}"

        else:

            build_source_packages = (
                "libgirepository1.0-dev libbz2-dev libreadline-dev "
                "libssl-dev zlib1g-dev libsqlite3-dev wget curl llvm "
                "libncurses5-dev libncursesw5-dev xz-utils tk-dev "
                "libcairo2-dev libzmq5"
            )

            packages = f"{packages} {build_source_packages}"
            unknown_packages = debian_unknown_packages(packages)
            if unknown_packages:
                for package in unknown_packages:
                    print(
                        _(
                            "The following package is unknown on your system: {}\n"
                        ).format(package)
                    )
                cleanup_on_exit(
                    installer_to_delete_on_error=installer_to_delete_on_error
                )
                sys.exit(1)

        optional_packages = [
            "libmediainfo0v5",
            "gir1.2-unity-5.0",
        ]
        if have_apt:
            for p in optional_packages:
                if p in cache:
                    packages = "{} {}".format(packages, p)
        else:
            extra_packages = " ".join(
                debian_known_packages(" ".join(optional_packages))
            )
            if extra_packages:
                packages = "{} {}".format(packages, extra_packages)

        # In Ubuntu 18.04 and newer, python3-gphoto2 is packaged as python3-gphoto2
        # (In Ubuntu 16.04 and older, the python package name gphoto2 was unfortunately
        # taken by python3-gphoto2cffi, which was to become an abandoned package).

        use_system_python3_gphoto2 = False

        # Determine the available version of python3-gphoto2:
        if have_apt and not venv:
            cache = apt.Cache()
            if "python3-gphoto2" in cache:
                versions = [
                    LooseVersion(v.version) for v in cache["python3-gphoto2"].versions
                ]
                version = max(versions)
                # Ensure gphoto2 minimum version in requirements.txt is consistent
                # with this value:
                use_system_python3_gphoto2 = version >= LooseVersion("1.8.2")

        if use_system_python3_gphoto2:
            packages = f"{packages} python3-gphoto2"
        else:
            packages = f"{packages} libgphoto2-dev"

        for package in packages.split():
            if have_apt:
                try:
                    p = cache[package]
                    if not p.is_installed:
                        missing_packages.append(package)
                    elif system_uninstall and p.is_auto_installed:
                        set_manually_installed.append(package)
                except KeyError:
                    print(
                        _(
                            "The following package is unknown on your system: {}\n"
                        ).format(package)
                    )
                    cleanup_on_exit(
                        installer_to_delete_on_error=installer_to_delete_on_error
                    )
                    sys.exit(1)
            else:
                if not debian_package_installed(package):
                    missing_packages.append(package)

        if missing_packages:
            print(
                _(
                    "To continue, some packages required to run the application will "
                    "be installed."
                )
                + "\n"
            )

            run_cmd(
                make_distro_packager_command(
                    distro_family, " ".join(missing_packages), interactive
                ),
                interactive=interactive,
                installer_to_delete_on_error=installer_to_delete_on_error,
            )

        # If there are any packages to mark as manually installed, do so now
        if set_manually_installed:
            run_cmd(
                make_distro_mark_commmand(
                    distro_family, " ".join(set_manually_installed)
                ),
                interactive=interactive,
                installer_to_delete_on_error=installer_to_delete_on_error,
            )

    elif distro_family == Distro.fedora:  # Includes CentOS / CentOS Stream >= 8

        missing_packages = []

        packages = (
            "gstreamer1-plugins-good "
            "zeromq-devel exiv2 perl-Image-ExifTool gcc-c++ "
            "rpm-build intltool libmediainfo python3-wheel zenity "
            "gstreamer1-libav "
        )

        # CentOS does not include ifuse
        if distro == Distro.fedora:
            packages = "ifuse libimobiledevice-utils {}".format(packages)

        if install_pyqt5:
            packages = (
                f"{packages } qt5-qtimageformats python3-qt5 qt5-qtsvg qt5-qtwayland"
            )

        if distro in (Distro.fedora, Distro.centos_stream9):
            packages = "{} python3-devel".format(packages)
        else:
            assert distro in (Distro.centos8, Distro.centos_stream8)
            packages = "{} python36-devel".format(packages)

        if not venv:

            base_python_packages = (
                "python3-easygui python3-psutil "
                "python3-tornado gobject-introspection python3-gobject "
                "python3-babel python3-pillow"
            )

            if distro == Distro.fedora:
                base_python_packages = (
                    f"{base_python_packages} python3-gexiv2 python3-arrow "
                    "python3-sortedcontainers python3-zmq python3-colour "
                    "python3-colorlog python3-pymediainfo python3-tenacity"
                )
                base_python_packages = f"{base_python_packages} python3-gphoto2"
            else:
                base_python_packages = (
                    f"{base_python_packages} gobject-introspection-devel "
                    "cairo-gobject-devel "
                )
                base_python_packages = f"{base_python_packages} libgphoto2-devel"

            packages = "{} {}".format(packages, base_python_packages)

            if not have_requests:
                packages = "python3-requests {}".format(packages)

        else:
            build_source_packages = (
                "gcc zlib-devel bzip2 bzip2-devel readline-devel "
                "sqlite sqlite-devel openssl-devel tk-devel git "
                "cairo-gobject-devel "
                "gobject-introspection-devel zeromq"
            )
            build_source_packages = f"{build_source_packages} libgphoto2-devel"

            if distro == Distro.fedora:
                build_source_packages = "{} python3-cairo-devel".format(
                    build_source_packages
                )

            packages = "{} {}".format(packages, build_source_packages)

            print(
                _("Querying installed and available packages (this may take a while)")
            )

            unknown_packages = fedora_unknown_packages(packages)
            if unknown_packages:
                for package in unknown_packages:
                    print(
                        _(
                            "The following package is unknown on your system: {}\n"
                        ).format(package)
                    )
                cleanup_on_exit(
                    installer_to_delete_on_error=installer_to_delete_on_error
                )
                sys.exit(1)

        libunity_package = "python3-libunity"

        if have_dnf:

            print(
                _("Querying installed and available packages (this may take a while)")
            )

            with dnf.Base() as base:
                dnf_prepare_base(base)

                # A query matches all packages in sack
                q = base.sack.query()

                # Derived query matches only available packages
                q_avail = q.available()
                # Derived query matches only installed packages
                q_inst = q.installed()

                installed = [pkg.name for pkg in q_inst.run()]
                available = [pkg.name for pkg in q_avail.run()]

                for package in packages.split():
                    if package not in installed:
                        if package in available:
                            missing_packages.append(package)
                        else:
                            sys.stderr.write(
                                "The following package is unavailable on your "
                                "system: {}\n".format(package)
                            )
                            cleanup_on_exit(
                                installer_to_delete_on_error=installer_to_delete_on_error
                            )
                            sys.exit(1)

                uninstall_libunity = libunity_package in installed

        else:
            for package in packages.split():
                if not fedora_package_installed(package):
                    missing_packages.append(package)

            uninstall_libunity = fedora_package_installed(libunity_package)

        if missing_packages:
            print(
                _(
                    "To continue, some packages required to run the application "
                    "will be installed."
                )
                + "\n"
            )
            run_cmd(
                make_distro_packager_command(
                    distro_family, " ".join(missing_packages), interactive
                ),
                interactive=interactive,
                installer_to_delete_on_error=installer_to_delete_on_error,
            )

        if uninstall_libunity:
            print(
                f"{libunity_package} will be uninstalled from this system because it "
                "is currently broken in Fedora"
            )
            run_cmd(
                make_distro_packager_command(
                    distro_family, libunity_package, interactive, command="remove"
                ),
                interactive=interactive,
                installer_to_delete_on_error=installer_to_delete_on_error,
            )

    elif distro_family == Distro.opensuse:

        packages = (
            "zeromq-devel exiv2 exiftool python3-devel "
            "gcc-c++ rpm-build intltool zenity "
            "ifuse imobiledevice-tools "
        )

        if install_pyqt5:
            packages = (
                f"{packages} python3-qt5 libqt5-qtimageformats libQt5Svg5 "
                "libqt5-qtwayland"
            )

        if not venv:
            base_python_packages = (
                "girepository-1_0 python3-gobject "
                "python3-psutil python3-tornado python3-Babel "
                "typelib-1_0-GExiv2-0_10 typelib-1_0-UDisks-2_0 "
                "typelib-1_0-Notify-0_7 "
                "typelib-1_0-Gst-1_0 typelib-1_0-GUdev-1_0 "
                "python3-arrow"
            )
            base_python_packages = f"{base_python_packages} python3-gphoto2"

            packages = f"{packages} {base_python_packages}"

            if not have_requests:
                packages = f"python3-requests {packages}"

        else:
            build_source_packages = (
                "gobject-introspection-devel python3-cairo-devel " "openssl zlib git"
            )
            build_source_packages = f"{build_source_packages} libgphoto2-devel"
            packages = f"{packages} {build_source_packages}"

        libmediainfo = "libmediainfo0"
        if opensuse_known_packages(libmediainfo):
            packages = f"{packages} {libmediainfo}"
        else:
            print("Could not locate package", libmediainfo)

        libunity_packages = opensuse_known_packages(
            "typelib-1_0-UnityExtras-7_0 typelib-1_0-Unity-7_0 "
            "typelib-1_0-Dbusmenu-0_4 typelib-1_0-Dee-1_0 "
        )
        if libunity_packages:
            packages = "{} {}".format(packages, " ".join(libunity_packages))

        print(
            # Translators: do not translate the term zypper
            _(
                "Querying zypper to see if any required packages are already installed "
                "(this may take a while)... "
            )
        )
        try:
            missing_packages = opensuse_missing_packages(packages)
        except subprocess.CalledProcessError as e:
            if e.returncode != 104:
                sys.stderr.write(_("Command failed") + "\n")
                sys.stderr.write(_("Exiting") + "\n")
                cleanup_on_exit(
                    installer_to_delete_on_error=installer_to_delete_on_error
                )
                sys.exit(1)
        else:
            if missing_packages:
                print(
                    _(
                        "To continue, some packages required to run the application "
                        "will be installed."
                    )
                    + "\n"
                )
                run_cmd(
                    make_distro_packager_command(
                        distro_family, " ".join(missing_packages), interactive
                    ),
                    interactive=interactive,
                    installer_to_delete_on_error=installer_to_delete_on_error,
                )

            if venv:
                run_cmd(
                    "sudo zypper install -y --type pattern devel_basis",
                    interactive=interactive,
                    installer_to_delete_on_error=installer_to_delete_on_error,
                )

    else:
        check_packages_on_other_systems(
            installer_to_delete_on_error=installer_to_delete_on_error
        )


